INSERT INTO `products` (`id`, `Name`, `Categorie`, `Price`, `Description`, `Pictures`, `id_seller`) VALUES
(1, 'Mens Citizen Endeavour Watch', 'Watches', 299, 'One of our bestsellers, and with good reason, the Mens Citizen Endeavour Watch is a stylish performer ideally suited to sports lovers and fitness fanatics. \r\n\r\nFirst up, it’s water resistant to 200 metres, so it’s the perfect choice for scuba divers, swimmers and snorkellers. Non-reflective mineral glass keeps it clear and highly visible even when underwater, while Eco-Drive means the watch is powered by natural light, so no need for costly batteries. \r\n\r\nThe vivid green dial makes a bold design statement, with orange accents and chunky white hour baton markers, and a date window at 3 o’clock. The stylish stainless steel bracelet is the perfect match for the colourful dial, and makes the Mens Citizen Endeavour Watch a winning combo of good looks and strong performance. ', 'AW1428-53X.jpg', 1004),
(2, 'Mens Tissot Chrono XL', 'Watches', 300, 'Exclusive to WatchShop, the Tissot Chrono XL Chronograph watch makes a big statement with its cool looks and on-trend style. \r\n\r\nThree subdials help you keep perfect track of time, covering hours, minutes and seconds, and there’s a date function, too. It’s also water resistant to 100 metres, so whether you’re a water sports fan or keen to hit the beach, it’s ideal. \r\n\r\nThe Tissot Chrono XL Exclusive Chronograph watch strikes the perfect balance between informal and smart with its low-key fabric strap and powerful black-and-blue colour scheme. Hard-wearing sapphire glass keeps it looking good as new, while the luminescent hands mean the watch looks great even when the sun goes down. Sporty, sophisticated, stylish – what more do you need? \r\n\r\nWater-resistant to 100m, great for swimming and water sports\r\nChronograph function for elapsed time measurement, adding functionality\r\nLuminescent hands, allowing for easy time-reading in the dark\r\nPowered by a quartz watch movement for superb time accuracy', 'T1166173705100.jpg', 1004),
(3, 'Mens Tissot Tradition', 'Watches', 550, 'Mens Tissot Tradition Automatic Watch T0634282203800', 'T0634282203800.jpg', 1004),
(4, 'Mens Casio Edifice Chronograph', 'Watches', 133, 'Part of the Casio Edifice Collection, the Men\'s Casio Edifice Chronograph Watch is a sharp performer with looks to match. \r\n\r\nThe Edifice features a triple sub-dial chronograph measuring hours, minutes and seconds, so it\'s ideal for keeping tabs on your training runs. There\'s also a countdown bezel that rotates as time elapses, and a stopwatch that measures to 1/1000th second accuracy. Solar power means no more costly batteries, and it\'s water resistant to 100 metres, so you can take it in the water for swimming and snorkelling. \r\n\r\nSplashes of yellow on the bezel and chronograph ramp up the designer look of the Edifice watch, which also features chunky silver hour baton markers and a hardwearing stainless steel strap plus a safety catch so it\'ll stay secure. On-trend urban styling and great performance makes the Men\'s Casio Edifice Chronograph Watch the perfect watch for busy guys on the go. \r\n\r\nWater-resistant to 100m, great for swimming and water sports\r\nChronograph function for elapsed time measurement, adding functionality\r\nPowered by a quartz watch movement for superb time accuracy\r\nLong lasting and rust-resistant stainless steel case', 'EFS-S550DB-1AVUEF.jpg', 1004),
(5, 'Gc Watch ', 'Watches', 3450, 'Gc Structura Y35002G7MF is a functional and handsome Gents watch from Sport Chic collection. Case is made out of Stainless Steel, which stands for a high quality of the item while the dial colour is Blue. The features of the watch include (among others) a chronograph. 100 metres water resistancy will protect the watch and allows it to get submerged in the water for everyday usage including swimming, but not high impact water sports. The watch is shipped with an original box and a guarantee from the manufacturer.', 'Y35002G7MF.jpg', 1004),
(6, 'Mens Hugo Boss Master', 'Watches', 1830, 'Practical and reliable, the BOSS Master timepieces provide the perfect accessory for the man whose style is all about dressing for success. This classic and refined watch features a 42mm gold Ion Plated case, distinctive guilloche black dial, gold Ion Plated bracelet and push button deployment.', '1513739_LRG_rgb_Web.jpg', 1004),
(7, 'Exclusive Gents Skymaster', 'Watches', 299, 'The BOSS Skymaster collection is as practical as it is adventurous, and this chronograph watch from the range takes all the best elements of the aviator inspired design we\'ve become accustomed to from BOSS. \r\n\r\nThis is a classic pilot design enhanced through features such as three subdials and a signature deep blue dial colour. With its stainless steel case and 50 metres water resistance, this sleek gents watch is as comfortable in an office as it is a bar. It\'s pared-back finish and mineral glass give a sophisticaed look to this aeronautical themed signature from BOSS, with all the reassurance that comes buying from such a brand. \r\n\r\nWater-resistant to 50 metres, so you don’t have to remove it when washing your hands\r\nPowered by a quartz watch movement for superb time accuracy', '1513784_LRG_rgb_Web.jpg', 1014),
(8, 'Ladies BOSS Iconic Mesh', 'Watches', 189, 'Hugo Boss Ladies Iconic 1502491 is an incredible attractive Ladies watch from Ladies Iconic collection. Case is made out of Stainless Steel, which stands for a high quality of the item and the Blue dial gives the watch that unique look. This model has got 30 metres water resistancy - it can be worn in scenarios where it is likely to be splashed but not immersed in water. It can be worn while washing your hands and will be fine in rain. The watch is shipped with an original box and a guarantee from the manufacturer.', '1502491.jpg', 1014),
(9, 'Mens Hugo Boss William', 'Watches', 142, 'Hugo Boss William Multifunction 1513619 is an amazing and special Gents watch from William collection. Case is made out of Rose Gold Ion-plated Steel while the dial colour is Grey. In regards to the water resistance, the watch has got a resistancy up to 30 metres. It means it can be worn in scenarios where it is likely to be splashed but not immersed in water. It can be worn while washing your hands and will be fine in rain. The watch is shipped with an original box and a guarantee from the manufacturer.', '1513619_Soldier_300dpi.jpg', 1014),
(799, 'Pizza tartuffo', 'Accessories', 10000, 'Pizza tartuffo', 'pizza.jpg', 1014),
(5684, 'Tacos', 'Watches', 15620, 'Tacos 15 viandes ', 'tacos.jpg', 1004),
(65843, 'Gold Metal Sunglasses', 'Accessories', 1345, 'This metal square shape gold colored frame with green colored lenses is characterized by the temples that are embellished by a diamond cut cylinder with a geometrical pattern, inspired by the Montblanc Meisterstück writing instruments. The three rings detail on the end tip recall the three rings of the Montblanc pen.', 'w2500.jpg', 1014),
(65844, 'Square Frame Metal Sunglasses', 'Accessories', 1350, 'These metal square sunglasses with coloured lenses and double bridge offer the classic square style, with an extra bold detail on the lens profile. A refined tubular temple, recalling the cross section of the snowcap emblem, creates a sophisticated look. The Montblanc emblem is embossed on the temple, which is then enriched by a three-ring detail at the tip. Calibre 61. Lenses by Zeiss.', 'w2501.jpg', 11),
(65845, 'Rectangular Black Metal Frame Sunglasses', 'Accessories', 1500, 'These rectangular shape sunglasses with grey coloured lenses and black coloured frame provide a sporty look and feel. The rubberized end tip is embellished by a racing inspired pattern and the straight temple enhances the functionality for this urban lifestyle model.', 'w2502.jpg', 11),
(65846, 'Wild Kong, 2020, Richard Orlinski', 'Accessories', 13500, 'Richard Orlinski is a French artist who was born in Paris in 1966. In 2004 he started to make sculptures and has always been surrounded of a team of highly skilled technicians. His artworks, designed with the concept \"Born Wild\" reflect the main values in a contemporary style, which never yields to the trash, the extravagance or the ephemeral.', 'gorilla.jpg', 11),
(65847, 'Pascal thomas, Jumping horse', 'Accessories', 1360, 'It was then that Pascal Thomas discovered his ability to sculpt as a math physics student. He first tried it on sand and then on recycled materials.\r\nNourished by the success of his creations, Pascal feels the desire to master another less alterable material. He naturally turned to the noblest of all statutory alloys, bronze, and explored the lost wax technique.', 'horse.jpg', 11),
(65848, 'Pascal Thomas, Elephant head\r\n', 'Accessories', 956, 'This sculpture depicts an elephant\'s head ripping off a tree stump.', 'elephant.jpg', 11);
